     mso-ansi-language:ES-GT'>Estacin 334-89 K (Kaliana)<o:p></o:p></span></u></b></p>
     <p class=MsoNormal><span lang=ES-GT style='color:white;mso-themecolor:
     background1;mso-ansi-language:ES-GT'>Esta estacin es un Proyecto de parte
     de Kenyan Industries Corp. <o:p></o:p></span></p>
     <p class=MsoNormal><span lang=ES-GT style='color:white;mso-themecolor:
     background1;mso-ansi-language:ES-GT'>Que improvisar el miedo ambiente
     dentro de la estacin haciendo que las plantas en ella reproduzcan
     suficiente oxgeno para para ms habitantes, de una forma econmica. El
     nuevo diseo estructural que se le dar, ayudar a alcanzar velocidades
     ms cercanas a la velocidad de la luz, lo que har llegar a otros planetas
     ms repentino.<o:p></o:p></span></p>
